import Player from "./Player";
import { playerDetails } from "./Players";
import 'bootstrap/dist/css/bootstrap.min.css';

function PlayerList()
{
    return (

        
            playerDetails.map(myPlayer => 
            {
                  
               return  < Player 
               nom={myPlayer.nom} 
               imagePath={myPlayer.imagePath} 
               team={myPlayer.team}
               nationality={myPlayer.nationality}
               jerseyNumber={myPlayer.jerseyNumber}
               age={myPlayer.age}
               

               
               />

            })
        
          
    

            

    );
}

export default PlayerList
